import React from 'react';
import logo from './logo.svg';
import './App.css';

function Heading(){
  return(
    <div className="promo-section">
            <div>
                <h1>Don't miss this deal!</h1>
                </div>
                <div>
                <h2>Subscribe to my newsletter and get all the shop items at 50% off!</h2>
            </div>
        </div>
  );
}
function Nav() {
  return (
      <nav className="main-nav">
          <ul>
              <li>Home</li>
              <li>Articles</li>
              <li>About</li>
              <li>Contact</li>
          </ul>
      </nav>
  );
};

function App() {
  return <Nav/>;
  return <Heading/>
}

export default App;
